import React from 'react';
import { IonContent, IonFooter, IonToolbar, IonTitle } from '@ionic/react';

const Footer = () => {
    return (
      <IonFooter className="ion-no-border">
        <IonToolbar>
          <IonTitle>Footer - No Border</IonTitle>
        </IonToolbar>
      </IonFooter>

    );
  }

export default Footer;
